import React from 'react';
import { MDBTable, MDBTableBody, MDBTableHead } from 'mdbreact';

const NeoTable = () => {
const data = {
  columns: [
    {
      label: '#',
      field: 'id',
      sort: 'asc'
    },
    {
      label: 'Designation ',
      field: 'Designation',
      sort: 'asc'
    },
    {
      label: 'Orbit ID',
      field: 'Orbit ID',
      sort: 'asc'
    },
    {
      label: 'Close-approach',
      field: 'Close-approach',
      sort: 'asc'
    },
    {
        label: 'Distance (AU)',
        field: 'Distance (AU)',
        sort: 'asc'
    },
    {
        label: 'Minimum approach distance (AU)',
        field: 'Minimum approach distance (AU)',
        sort: 'asc'
    },
    {
        label: 'Maximum approach distance (AU)',
        field: 'Maximum approach distance (AU)',
        sort: 'asc'
    },
    {
        label: 'Velocity',
        field: 'Velocity',
        sort: 'asc'
    }, 
    {
        label: 'Magnitude',
        field: 'Magnitude',
        sort: 'asc'
    },  

  ],
  rows: [
    {
        'id': 5,
        'Designation': 'Jacob',
        'Orbit ID': 'Thornton',
        'Close-approach': '@fat',
        'Distance (AU)':"1",
        'Minimum approach distance (AU)':"1",
        'Maximum approach distance (AU)': "1" ,
        'Velocity': "1",
        'Magnitude': "1"
      },
  ]
};

return (
    <MDBTable scrollY>
      <MDBTableHead columns={data.columns} />
      <MDBTableBody rows={data.rows} />
    </MDBTable>
  );
};

export default NeoTable;
